import React, { Component } from "react";
import { NavLink,  withRouter } from "react-router-dom";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";

import "./Sidenav.css";
import logo from "../../images/logo3.png";
import { faHome, faTachometerAlt, faSignOutAlt, faUsers, faDownload, faChartLine} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class SideNav extends Component {
  onLogoutClick = e => {
    this.props.logoutUser(this.props.history);
    window.location.href = "/";
  };

 
  render() {
    const { user } = this.props.auth;
    return (
    <div id="sidebar-collapse" className="col-sm-3 col-lg-2 sidebar">
      <div className="profile-sidebar">
       <div className="profile-userpic">
          <img src={logo}  className="img-responsive" alt=""/>
        </div>
        <div className="profile-usertitle">
          <div className="profile-usertitle-name">  <h5 style={{ fontFamily:  "Nexa Light"}}>
                <center><b>Hello Admin,</b> {user.name.split(" ")[0]}</center>
              </h5></div>
              
          <div className="profile-usertitle-status"><span className="indicator label-success"></span>Online</div>
        </div>
        <div className="clear"></div>
      </div>
      <div className="divider"></div>
      {/* <form role="search">
        <div className="form-group">
          <input type="text" className="form-control" placeholder="Search"></input>
        </div>
      </form> */}
      <div className="side side-nav fixed">
      <ul className="top">
          <NavLink exact activeClassName="active-page" to="/dashboard"  style={{color: "#FF9933", fontFamily:  "Nexa Light" }}>
              <FontAwesomeIcon icon={faTachometerAlt} style={{marginRight: "30px", marginLeft: "10px"}} ></FontAwesomeIcon>Dashboard
          </NavLink>
        <li exact activeclassName="active-page" to="/home"><a href="/home"><em className="fa fa-home">&nbsp;</em> Home</a></li>
        <li exact activeclassName="active-page" to="/investor"><a href="/investor"><em className="fa fa-line-chart">&nbsp;</em> Investor Relation</a></li>
        <li exact activeclassName="active-page" to="/members"><a href="/members"><em className="fa fa-users">&nbsp;</em> Members</a></li>
        <li exact activeclassName="active-page" to="/downloadables"><a href="/downloadables"><em className="fa fa-download">&nbsp;</em> Downloadables</a></li>
        <li exact activeclassName="active-page" to="/" onClick={this.onLogoutClick}><a href="/"><em className="fa fa-power-off">&nbsp;</em> Logout</a></li>
      </ul>
      </div>
	  </div>
    );
  }
}
const mapStateToProps = state => ({
  projects: state.projects,
  auth: state.auth
});

export default withRouter(
  connect(
    mapStateToProps,
    { logoutUser }
  )(withRouter(SideNav))
);
